The Schema of a GraphQL contains a required Query, an optional Mutation, and an optional Subscription. These object types are described using the structure of the Rust language. The field of the structure corresponds to the field of the GraphQL object, but you need to mark it with #[field] so that the procedure macro provided by Async-graphql can correctly recognize it. Async-graphql implements the mapping of common data types to GraphQL types, such as i32, f64, Option<T>, Vec<T>, etc. Also, you can extend these base types , which are called scalars in the GraphQL. Here is a simple example where we provide just one query that returns the sum of a and b. use async_graphql::*; struct Query; #[Object]
impl Query { #[field(desc = "Returns the sum of a and b")] async fn add(a: i32, b: i32) -> i32 { a + b }
}
